    use Response;

    public function index()
    {
        if (auth()->guard('user_web')->check()) {
            return redirect()->route('user.web.dashboard.index');
        }

        if (auth()->guard('employee_web')->check()) {
            return redirect()->route('employee.web.dashboard.index');
        }

        if (auth()->guard('market_web')->check()) {
            return redirect()->route('market.web.dashboard.index');
        }

        return view('home.modules.index.index');
    }

    public function test(Request $request)
    {
        $jobDepartments = JobDepartment::all();
        foreach ($jobDepartments as $jobDepartment) {
            $status = 1;
            $employees = $jobDepartment->employees()->get()->shuffle();
            foreach ($employees as $employee) {
                $employee->saturday_permit_order = $status;
                $employee->save();
                $status = $status == 1 ? 0 : 1;
            }
        }
    }

    public function test2(Request $request)
    {
        return [
            '1' => Employee::where('saturday_permit_order', 1)->where('company_id', 2)->where('leave', 0)->get(),
            '0' => Employee::where('saturday_permit_order', 0)->where('company_id', 2)->where('leave', 0)->get(),
        ];
        return [
            'on' => SaturdayPermit::where('date', '2022-08-06')->where('status', 'on')->get(),
            'off' => SaturdayPermit::where('date', '2022-08-06')->where('status', 'off')->get()
        ];
        return [
            'status0' => Employee::whereIn('company_id', [1, 2])->where('leave', 0)->where('saturday_permit_order', 0)->get(),
            'status1' => Employee::whereIn('company_id', [1, 2])->where('leave', 0)->where('saturday_permit_order', 1)->get(),
        ];
    }

